import React from "react";
import "./css/CovidAdd.css";
import { HiOutlineChevronDoubleRight, HiArrowRight } from "react-icons/hi";

function CovidAdd() {
  let date = new Date();
  date.toString();
  const months = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
  ];
  let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  const [today, day_idx, month, year] = [
    date.getUTCDate(),
    date.getDay(),
    date.getMonth(),
    date.getFullYear(),
  ];
  let current_month = months[month];
  let today_day = days[day_idx];
  return (
    <div className="covid">
      <div className="alert__text">
        <p>
          <span className="news__covid">Update news</span>
          {<HiArrowRight className="chev__double" />}
          Information about Covid-19
        </p>
      </div>
      <div className="date__container">
        <p>
          {today} {current_month} {year} |
          <span className="date__day">{today_day}</span>
        </p>
      </div>
    </div>
  );
}

export default CovidAdd;
